import React from 'react';
import './DropdownMenu.css'; // DropdownMenu için özel stil dosyası

const DropdownMenu = ({ items, className }) => {
  return (
    <div className={`dropdown-menu ${className}`}>
      {items.map((item, index) => (
        <a href="#" key={index}>
          {item}
        </a>
      ))}
    </div>
  );
};

export default DropdownMenu;
